(ns slothtest.autogen_test (:require [clojure.test :refer :all]))

(def
 test-data
 {'(* 1 2) '2,
  '(+ 1 2) '3,
  '(/ 1 2) '1/2,
  '(for [i [1 2 3]] (* 2 i)) '(2 4 6),
  '3 '3})

(deftest
 autogen
 (testing
  "Autogenerated"
  (is (= (* 1 2) '2))
  (is (= (+ 1 2) '3))
  (is (= (/ 1 2) '1/2))
  (is (= (for [i [1 2 3]] (* 2 i)) '(2 4 6)))
  (is (= 3 '3))))